import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Peripatetik LLC</h3>
        <p>mid-15c., <i>Peripatetik,</i> "a disciple of Aristotle, one of the set of philosophers who followed the teachings of Aristotle," from Old French <i>perypatetique</i> (14c.) and directly from Medieval Latin peripateticus "pertaining to the disciples or philosophy of Aristotle," from Greek peripatÄ“tikos "given to walking about" (especially while teaching), from peripatein "walk up and down, walk about," from peri "around, about" (see peri-) + patein "to walk, tread" (see find (v.)). Aristotle's custom was to teach while strolling through the Lyceum in Athens.</p>
      </header>
    </div>
  );
}

export default App;
